function renderRows(row) {
    return <ColumnsPerRow column={row} />
}

function ColumnsPerRow(props) {
    return <tr>{props.column.map((data) => {return <Column data={data} />})}</tr>
}

function Column(props) {
    const data = props.data;

    return <td className={data.cssTd} colspan={data.colspan} title={data.title}>
        <a className={data.cssLink} href="">
            <i className={data.cssIcon}></i>
            <div><p className={data.cssType}>{data.type}</p></div>
        </a>
    </td>
}

